// SPDX-Licencse-Identifier: MIT
pragma solidity ^0.8.0;

contract Oracle {
    address owner;
    uint256 public numberAsteroids;

    event __callbackNewData();

    constructor() public {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner");
        _;
    }

    function update(uint256 num) public onlyOwner {
        numberAsteroids = num;
    }
}
